import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor(){
    super();

    this.state = {
      houses: []
    };
  }

  componentDidMount(){
    fetch('https://my-json-server.typicode.com/karenhernandeze/Casas/db')
    .then(response => response.json())
    .then(db => console.log(db.posts.title)); // this.setState({houses: db})); //console.log(users));
  }

  render() {
    return (
      <div className="App">
      {this.state.houses.map(house => (
        <h1 key={house.id}> {house.title} </h1>
        ))}
      </div>
    )
  }
}

export default App;
